    else if (dst is X86Gp && src is int) asm.movRI64(dst, src);
    else if (dst is X86Gp && src is X86Mem) asm.movRM(dst, src);
    else if (dst is X86Mem && src is X86Gp) asm.movMR(dst, src);
  }
